def sumSubseqWidths(nums):
    n=len(nums)
    if n <= 1: return 0
    if n == 2: return max(nums)-min(nums)
    mod=10**9+7
    nums.sort()
    prefix_sums=[0]*len(nums)
    prefix_sums[n-1]=nums[n-1]
    for x in range(n-2, -1, -1):
        prefix_sums[x]=(prefix_sums[x+1]*2+nums[x])%mod

    widths=0
    power=2**(n-1)
    for s in range(0, n-1):
        widths+=prefix_sums[s+1]-nums[s]*(power)+nums[s]
        power//=2
        widths%=mod
        


    return widths

